211.source:
function snippets() {
    return;  // don't exec this method!

// This snippet lets you drop a binary file on the world
//  and it will open an inspector on a UInt8 array
$world.onHTML5Drop = function (evt) {
    var reader = new FileReader();
    var file = evt.dataTransfer.files[0];
    reader.onload = function (e) {
        var buffer = e.target.result;
        lively.morphic.inspect(new Uint8Array(buffer))
    }
    reader.readAsArrayBuffer(file);
    evt.stop(); return true;
}

// Eval this snippet in that inspector to install in the reader
$morph('ImageReader').ot = this;  // for the OT
$morph('ImageReader').data = this;  // for the data

var words = new Array(this.length/2);
for (var i=0; i<this.length; i+=2) {
    words[i/2] = this[i] + 256*this[i+1];
}

}

214.source:
function reset() {  // this.reset()
    this.minOop = 0;
    this.maxOop = this.ot.length/4 - 1;
    this.dataBias = 49152;
    this.get("Tree").setItem({
        name: 'no image loaded',
        style: {color: Color.web.darkgray}});
    this.get("Editor").doitContext = this;
    this.get("Editor").setTextString("this");
}

217.source:
function printObj(oop) {  // this.printObj(0)
    // print first 32 objects
    // for (var oop=0; oop<80; oop+=4) {console.log(this.printObj(oop))}
    // print first 32 classes
    // for (var oop=0x40; oop<0x800; oop+=0x40) {console.log(this.printObj(oop))}

    // Decipher and print the object with the given oop
    var str = oop.toString(16) + ": ";
    var entry = this.OTat(oop);  // ot entry
    str += "entry=" + entry.toString(16) + "; ";
    str += "refct=" + (entry>>24) + "; ";
    str += "otherBits=" + ((entry>>16)&0xE1).toString(2) + "; ";
    var addr = this.dataAddress(oop);
    str += "addr=" + addr.toString(16) + "; ";
    var oClass = this.classOfOop(oop);
    str += "class=" + oClass.toString(16);
    str += "(" + this.classNameOfOop(oop) + "); ";
    var lenBits = this.lengthBitsAtAddr(addr);
    str += "lenBits=" + lenBits + "; ";
    if (this.isPointers(entry)) {
        str += "data={";
        for(var i=1; i<lenBits/2; i++) {
            str += this.shortPrint(this.fieldOfObject(i, oop));
        }
        str += "}";
    } else {
        str += "str=" + "'" + this.stringAtAddr(addr) + "'";
    }
    return str
}

220.source:
function OTat(oop) {  // this.OTat(1)
    // this.OTat(768/4).toString(16)
    // Return the OT entry for the given oop
    // Decode two two-byte numbers into one 32-bit number
    var i = oop;
    var val = 0;
    val = this.ot[i+1];
    val = val*256 + this.ot[i];
    val = val*256 + this.ot[i+3];
    val = val*256 + this.ot[i+2];
    return val
}

223.source:
function dataAddress(oop) {
    // this.dataAddress(768)46988
    var entry = this.OTat(oop);
    return (entry&0xFFFF) * 16 + ((entry>>16)&0x1E) - this.dataBias
}

229.source:
function lengthBitsAtAddr(addr) {
	var len = this.data[addr] & 0x3F;
	if (len > 0) return len;
	return this.data[addr-1] * 256 + this.data[addr-2];
}

232.source:
function fieldOfObject(i, oop) { 
    // i = 1 for first field after class
	var addr = this.dataAddress(oop);
	var a = addr+(2*i);
	return this.data[a+1]*256 + this.data[a];
	//return [a, this.data[a+1], this.data[a]];
}

235.source:
function shortPrint(oop) {
    if (this.isInteger(oop)) return this.integerValueOf(oop).toString();
    if (oop == 0) return 'nil';
    if (oop == 4) return 'false';
    if (oop == 8) return 'true';
    if (this.classOfOop(oop) == 0xC0) return "'" + this.stringOfOop(oop) + "'";
    if (this.classOfOop(oop) == 0x340) return "#" + this.stringOfOop(oop);
    return "<" + this.classNameOfOop(oop) + ">";
}

241.source:
function integerValueOf(oop) {
    var val = oop>>1;
    return (val&0x4000)*-1 + (val&0x3FFF)
}

247.source:
function classOfOop(oop) { // this.classOfOop(0)
    return this.fieldOfObject(0, oop) & 0xFFC0;
}

250.source:
function stringAtAddr(addr) {
    var strLen = this.lengthBitsAtAddr(addr)-2;
    var str = "";
    for (var i=0; i<strLen+1; i++) {
        str += String.fromCharCode(this.data[addr+i+1]);
    }
    return str;
    // strLen _ (self lenBitsAtAddr: addr) - 2.
	// ^ (data copyFrom: addr+3 to: addr+3+strLen-1) asString
}

256.source:
function readObjects() {
    // create js objects for the st78 objects in ot+data
    this.st78Classes(); // ensure latest code is loaded
    var oopMap = {};
    for (var oop = 0; oop < this.ot.length; oop += 4)
        if (this.refCountOf(oop))
            oopMap[oop] = new St78.Object(oop);
    for (var oop in oopMap)
        oopMap[oop].installFromImage(oopMap);
    return oopMap;
}

259.source:
function makeTreeItem(label, object) {
    var self = this;
    var item = {
        doNotSerialize: ["object"],
        object: object,
        name: label + ": " +
            (object.stInstName ? object.stInstName() : object.toString()),
        children: !!object.pointers,
        onExpand: function(tree) {
            var n = 0;
            item.children = object.pointers.collect(function(child){
                return self.makeTreeItem(n+" ("+object.slotNameAt(++n)+")", child);
            });
        },
        onCollapse: function(tree) {
            item.children = true;      //release objects
        },
        onSelect: function(tree) {
            self.onSelect(object);
        }
    };
    if (object.bytes) item.description = "[" + object.bytes.length + " bytes]"; 
    if (object.words) item.description = "[" + object.words.length + " words]";
    return item;    
}

262.source:
function loadImage() {
    var oopMap = this.readObjects();
    var tree = this.get("Tree");
    var globalKeys = oopMap[16].pointers[0].pointers;
    var globalValues = oopMap[16].pointers[1].pointers;
    var globalsItems = this.makeGlobalsItems(oopMap[16]);
    var items = [];
    for (var oop = 0; oop <= this.maxOop; oop += 4)
        if (oopMap[oop])
            items.push(this.makeTreeItem(oop, oopMap[oop]))
    tree.setItem({children: [
        {name: "oops", children: items},
        {name: "globals", children: globalsItems}
    ]});
}

265.source:
function st78Classes() {
    var image = this;
    module('St78').requires().toRun(function() {
        Object.subclass('St78.Object', {
            initialize: function(oop) {
                this.oop = oop;
            },
            installFromImage: function(oopMap) {
                var entry = image.OTat(this.oop);
                var addr = image.dataAddress(this.oop);
                var classOop = image.classOfOop(this.oop);
                this.otEntry = entry;
                this.stClass = oopMap[classOop];
                var instSize = image.fieldOfObject(3, classOop) >> 1;
                var objBytes = instSize & 0x1000
                    ? image.lengthBitsAtAddr(addr) : instSize & 0x3FF;
                if (objBytes <= 2) return; // only class
                if (instSize & 0x4000) { // pointers
                    this.pointers = [];
                    for (var i = 1; i < objBytes/2; i++) {
                        var oop = image.fieldOfObject(i, this.oop);
                        var obj = oop & 1 ? image.integerValueOf(oop) : oopMap[oop];
                        this.pointers.push(obj);
                    }
                } else if (instSize & 0x2000) { // words
                    this.words = [];
                    for (var i = 1; i < objBytes/2; i++) {
                        var word = image.fieldOfObject(i, this.oop);
                        this.words.push(word);
                    }
                } else { // bytes
                    this.bytes = [];
                    for (var i = 2; i < objBytes; i++) {
                        var byte = image.data[addr + i];
                        this.bytes.push(byte);
                    }
                }
            },
            stInstName: function() {
                if (!this.stClass || !this.stClass.pointers) return "???";
                if (this.oop === 0) return "nil";
                if (this.oop === 4) return "false";
                if (this.oop === 8) return "true";
                if (this.stClass.oop === 0xC0) return "'" + this.bytesAsString() + "'";
                if (this.stClass.oop === 0x340) return "#" + this.bytesAsString();
                var classNameObj = this.stClass.pointers[0];
                if (!classNameObj.stClass) return "???";
                var className = classNameObj.bytesAsString();
                return (/^[aeiou]/i.test(className) ? 'an ' : 'a ') + className;
            },
            isNil: function() {
                return this.oop === 0;
            },
            bytesAsString: function() {
                if (!this.bytes) return '';
                return this.bytes.map(function(char) {
                    return String.fromCharCode(char); }).join('');
            },
            slotNameAt: function(index) {
                // one-based index
                var vars = this.stClass.allInstVarNames();
                return index <= vars.length ? vars[index - 1] : index.toString();
            },
            allInstVarNames: function() {
                var superclass = this.pointers[5];
                var vars = superclass.isNil() ? [] : superclass.allInstVarNames();
                var string = this.pointers[1].bytesAsString();
                // remove comments, make comma-separated
                string = string.replace(/"[^"]*"/g, ' ').replace(/\s+/g, ',');
                if (string.length)
                    vars = vars.concat(string.split(','));
                return vars;
            } 
        });
    });
}

268.source:
function onSelect(object) {
    var ed = this.get("Editor");
    if (object) {
        ed.doitContext = object;
        ed.textString = 'this // ';
        ed.textString += object.stInstName ? object.stInstName() : object.toString();
    } else {
        ed.doitContext = this;
        ed.textString = 'this // the interpreter';
    }
}

274.source:
function makeGlobalsItems(globalsObj) {
    var globalKeys = globalsObj.pointers[0].pointers;
    var globalValues = globalsObj.pointers[1].pointers;
    var globals = {};
    var keys = [];
    for (var i = 0; i < globalKeys.length; i++) {
        var keyObj = globalKeys[i];
        if (!keyObj.isNil()) {
            var key = keyObj.bytesAsString();
            var value = globalValues[i].pointers[0];
            globals[key] = value;
            keys.push(key);
        }
    }
    keys.sort(function(a,b){
        var x = globals[a].isNil && globals[a].isNil() ? 1 : 0, 
            y = globals[b].isNil && globals[b].isNil() ? 1 : 0;
        return x != y ? x - y : a.toLowerCase() > b.toLowerCase() ? 1 : -1});
    var items = [];
    for (var i = 0; i < keys.length; i++)
        items.push(this.makeTreeItem(keys[i], globals[keys[i]]));
    return items;
}
